import React from 'react';
import { NextPage } from 'next';
import { Invite } from '../components/invite/Invite';
import { withRedux } from '../redux/with-redux';

const IndexPage: NextPage = () => {
  return (
    <div>
      <h1>OK</h1>
      <Invite />
    </div>
  );
};

export default withRedux(IndexPage);
